        <p><span>{empData.firstName}</span><span>{empData.lastName}</span></p>
        <img src={empData.image} alt="yourImage" srcset="" className="w-20 h-20 rounded-[50%]" />
        <p>{empData.email}</p>
        <p>{empData.course}</p>
      </div>
      <div className="w-[80%] bg-fuchsia-800">kgjkgj</div>
      </div>
   

    </div>
  );
}

